import React, { useEffect, useState } from 'react'
import useReactRouter from 'use-react-router';
import Header from './header';
import HeaderChat from './headerChat';
import { Typography, makeStyles, Grid, Box, Button, ListItemAvatar, Avatar, List } from '@material-ui/core'
import classes from '*.module.css'
const scenarioLeft = require('../assets/scenarioLeft.png');
const scenarioRight = require('../assets/scenarioRight.png');
const baseBackGroundColor = '#4575b4';
const useStyles = makeStyles((theme) => ({
    wingWrapper: {
        position: 'relative',
        height: '116px',
        width: '65px',
    },
    leftWing: {
        position: "absolute",
        left: "10px"
    },
    rightWing: {
        position: "absolute",
        right: "10px"
    },
    textProp: {
        color: "#B79433",
        fontSize: '1rem',
        '& p:last-child': {
            fontSize: '34px',
            fontWeight: 'bold',
        },
        // position: "absolute",
        fontFamily: 'Hira Min Pro',
        textAlign: "center",
        // letterSpacing: "6px",
        // lineHeight: "40px",

    },
    buttonProp: {
        left: "40%",
        top: "50%",
        color: "#4575B4",
        fontSize: 15,
        position: "absolute",
        fontFamily: 'Hira Min Pro',
        textAlign: "center",
        letterSpacing: "6px",
        lineHeight: "40px",
    },
    wingImageTitleBlock: {
        display: 'flex',
        position: 'relative',
        justifyContent: 'center',
        alignItems: 'center',
        paddingTop: '70px',
    },
    imageTitleBlock: {
        display: 'flex',
        position: 'relative',
        justifyContent: 'center',
        alignItems: 'center',
        borderBottom: '1px solid #CBCBCB',
    },
    summaryContentsWrapper: {
        padding: '0 1rem 3rem',
    },
    summaryContentsBlock: {
        display: 'flex',
        position: 'relative',
        justifyContent: 'center',
        margin: '30px 0 100px',
        flexDirection: 'column',
        alignItems: 'center',
    },
    summaryContents: {
        width: '100%',
        maxWidth: '350px',
        height: 'auto',
        padding: '20px 27px',
        borderRadius: '12px',
        backgroundColor: '#ffffff',
    },
    rectangle: {
